import React from 'react';
import './App.css';
import ProtectedRoute from './authentication/ProtectedRoute';
import Logout from './authentication/Logout'
import { Router } from '@reach/router';

import Login from './pages/Login'
import Register from './pages/Register'
import Dashboard from './pages/Dashboard'
import Course from './pages/Course'
import NewObjective from './pages/NewObjective'
import EditObjective from './pages/EditObjective'
import NewActivity from './pages/NewActivity'
import EditActivity from './pages/EditActivity'
import Profile from './pages/Profile';
import Lost from './pages/404'


function App() {
  return (
    <div>
        <Router>
          <Login path = "/login"/>
          <Register path = "/register"/>
          <Dashboard path = "/" exact/>
          <Dashboard path = "/dashboard"/>
          <Course path = "/course/:id"/>
          <NewObjective path = "/objective/new"/>
          <EditObjective path = "/objective/edit"/>
          <NewActivity path = "/activity/new"/>
          <EditActivity path = "/activity/edit"/>
          <Profile path = "/profile"/>
          <Logout path='/logout' exact/>
          <Lost path = "*"/>
        </Router>
    </div>
  );
}


export default App;
